ge,"OK")}},"Error")\n\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\t\tlocal PluginSuccess,PluginResults = pcall(function()\n\t\t\tfor _,LoadedPlugin in pairs(Plugins) do\n\t\t\t\tif LoadedPlugin.VERSION >= 5 then\n\t\t\t\t\tfor _,Command in pairs(LoadedPlugin.Commands) do\n\t\t\t\t\t\tif Command.Details[CurrentPlayerLanguage] then\n\t\t\t\t\t\t\tfor _,N in pairs(Command.Details[CurrentPlayerLanguage].Name) do\n\t\t\t\t\t\t\t\tlocal ComparingAgainst = string.lower(LocaleHandler.Accents.Remove(Settings.Interface.Call..N),CurrentPlayerLanguage)\n\t\t\t\t\t\t\t\tif ComparingAgainst == SearchingFor then\t\t\t\t\t\t\t\t\t\n\t\t\t\t\t\t\t\t\tif Command.Enabled then\n\t\t\t\t\t\t\t\t\t\tValidCommand = true\n\t\t\t\t\t\t\t\t\t\tif PlayerRank >= Command.Rank then\n\t\t\t\t\t\t\t\t\t\t\tlocal CommandArguments = table.clone(Arguments)\n\t\t\t\t\t\t\t\t\t\t\ttable.remove(CommandArguments,1)\n\t\t\t\t\t\t\t\t\t\t\tCommand.Run(Player,CommandArguments,CommandEssentials,CurrentPlayerLanguage)\n\t\t\t\t\t\t\t\t\t\telse \n\t\t\t\t\t\t\t\t\t\t\tif Settings.Interface.NotificationType == "Classic" then\n\t\t\t\t\t\t\t\t\t\t\t\tPlayerCommunications.Message(Player,LocaleHandler.PhraseFromId(CurrentPlayerLanguage,"lackperms",{CommandToRun}),UILibraryModule.NotificationColors.Error,5)\n\t\t\t\t\t\t\t\t\t\t\telseif Settings.Interface.NotificationType == "Prompts" then \n\t\t\t\t\t\t\t\t\t\t\t\tSystem:PromptUser(Player,LocaleHandler.PhraseFromId(CurrentPlayerLanguage,"acsdenied"),LocaleHandler.PhraseFromId(CurrentPlayerLanguage,"lackperms",{CommandToRun}),UILibraryModule.PromptImages(Theme).Error,{{Id="OK",Text=LocaleHandler.PhraseFromId(CurrentPlayerLanguage,"OK")}},"Error")\n\t\t\t\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\tend)\n\t\tif not PluginSuccess then\n\t\t\tPlayerCommunications.Message(Player,PluginRe