ss then\n\tif UtilityBarCheckResults == true then\n\t\tUtilityBarEnabled = true\n\tend\nend\n\nfunction LockGuiToMouse()\n\tif Draggable then\n\t\tInitialMousePosition = Vector2.new(Mouse.X,Mouse.Y)\n\t\tInitialFramePosition = GUI.Main.Position\n\t\tDragMainEnabled = true\n\t\twait()\n\tend\nend\nfunction UnlockGuiToMouse()\n\tDragMainEnabled = false\n\tInitialMousePosition = Vector2.new(Mouse.X,Mouse.Y)\n\tInitialFramePosition = GUI.Main.Position\nend\n\n--Mouse frame creation--\nlocal MouseFrame = Instance.new("Frame")\nlocal MouseFrameContextLabel = Instance.new("TextLabel")\nlocal MouseFrameContextLabelUICorner = Instance.new("UICorner")\nMouseFrame.Name = "Mouse"\nMouseFrame.Parent = script.Parent\nMouseFrame.BackgroundTransparency = 1.000\nMouseFrame.Size = UDim2.new(0, 1, 0, 1)\nMouseFrame.AutoLocalize = false\nMouseFrameContextLabel.Name = "ContextLabel"\nMouseFrameContextLabel.Parent = MouseFrame\nMouseFrameContextLabel.BackgroundColor3 = Color3.fromRGB(55, 55, 55)\nMouseFrameContextLabel.BackgroundTransparency = 0.500\nMouseFrameContextLabel.Visible = false\nMouseFrameContextLabel.Font = Enum.Font.SourceSans\nMouseFrameContextLabel.Text = "The quick brown fox jumps over the lazy dog. \n This is a context popup."\nMouseFrameContextLabel.TextColor3 = Color3.fromRGB(255, 255, 255)\nMouseFrameContextLabel.TextSize = 16.000\nMouseFrameContextLabel.TextXAlignment = Enum.TextXAlignment.Left\nMouseFrameContextLabel.TextYAlignment = Enum.TextYAlignment.Top\nMouseFrameContextLabel.AutomaticSize = Enum.AutomaticSize.XY\nMouseFrameContextLabel.RichText = true\nMouseFrameContextLabel.AutoLocalize = false\nMouseFrameContextLabelUICorner.CornerRadius = UDim.new(0, 4)\nMouseFrameContextLabelUICorner.Parent = MouseFrameContextLabel\n------------------------\n\nGUI.Main.Topbar.DragBox.MouseButton1Down:Connect(LockGuiToMouse)\nMouse.Button1Up:Connect(UnlockGuiToMouse)\nGUI.Main.Topbar.DragBox.MouseButton1Up:Connect(UnlockGuiToMouse)\n\nlocal function ToggleMinimization()\n\tif UtilityBarEnabled then\n\t\tif not SizeCooldown then\n\t\t\tspawn(function()\n\t\t\t\tSizeCooldown = true\n\t\t\t\twait(0.2)\n\t\t\t\tSizeCooldown = false\n\t\t\tend)\n\t\t\tif not Minimized and not FullScale then\n\t\t\t\tLastScale = GUI.Main.Size\n\t\t\t\tLastPosition = GUI.Main.Position\n\t\t\t\tGUI.DisplayOrder = 999999999\n\t\t\t\tTweenService:Create(GUI.Main,TweenInfo.new(0.2,Enum.EasingStyle.Circular),{Size=UDim2.new(0,260,0,0),Position=UDim2.new(0.5,0,2,0)}):Play()\n\t\t\t\tGUI.Main.Content.Visible = false\n\t\t\t\tMinimized = true\n\t\t\t\tTrueScalingEnabled = false\n\t\t\telseif Minimized and not FullScale then\n\t\t\t\tTweenService:Create(GUI.Main,TweenInfo.new(0.2,Enum.EasingStyle.Circular),{Size=LastScale,Position=LastPosition}):Play()\n\t\t\t\twait(0.25)\n\t\t\t\tGUI.Main.Content.Visible = true\n\t\t\t\tMinimized = false\n\t\t\t\tTrueScalingEnabled = true\n\t\t\tend\n\t\tend\n\telseif not UtilityBarEnabled then\n\t\tif not SizeCooldown then\n\t\t\tspawn(function()\n\t\t\t\tSizeCooldown = true\n\t\t\t\twait(0.2)\n\t\t\t\tSizeCooldown = false\n\t\t\tend)\n\t\t\tif not Minimized and not FullScale then\n\t\t\t\tLastScale = GUI.Main.Size\n\t\t\t\tLastPosition = GUI.Main.Position\n\t\t\t\tTweenService:Create(GUI.Main,TweenInfo.new(0.2,Enum.EasingStyle.Circular),{Size=UDim2.new(0,260,0,0),Position=UDim2.new(0.5,0,1,-12)}):Play()\n\t\t\t\tTweenService:Create(GUI.Main.Topbar,TweenInfo.new(0.2,Enum.EasingStyle.Circular),{Position=UDim2.new(0.5,0,0,1)}):Play()\n\t\t\t\tGUI.Main.Content.Visible = false\n\t\t\t\tMinimized = true\n\t\t\t\tTrueScalingEnabled = false\n\t\t\t\tDraggable = false\n\t\t\telseif Minimized and not FullScale then\n\t\t\t\tTweenService:Create(GUI.Main,TweenInfo.new(0.2,Enum.EasingStyle.Circular),{Size=LastScale,Position=LastPosition}):Play()\n\t\t\t\tTweenService:Create(GUI.Main.Topbar,TweenInfo.new(0.2,Enum.EasingStyle.Circular),{Position=UDim2.new(0.5,0,0,-3)}):Play()\n\t\t\t\twait(0.2)\n\t\t\t\tGUI.Main.Content.Visible = true\n\t\t\t\tM