useFrameContextLabel = Instance.new("TextLabel")\nlocal MouseFrameContextLabelUICorner = Instance.new("UICorner")\nMouseFrame.Name = "Mouse"\nMouseFrame.Parent = script.Parent\nMouseFrame.BackgroundTransparency = 1.000\nMouseFrame.Size = UDim2.new(0, 1, 0, 1)\nMouseFrame.AutoLocalize = false\nMouseFrameContextLabel.Name = "ContextLabel"\nMouseFrameContextLabel.Parent = MouseFrame\nMouseFrameContextLabel.BackgroundColor3 = Color3.fromRGB(55, 55, 55)\nMouseFrameContextLabel.BackgroundTransparency = 0.500\nMouseFrameContextLabel.Visible = false\nMouseFrameContextLabel.Font = Enum.Font.SourceSans\nMouseFrameContextLabel.Text = "The quick brown fox jumps over the lazy dog. \n This is a context popup."\nMouseFrameContextLabel.TextColor3 = Color3.fromRGB(255, 255, 255)\nMouseFrameContextLabel.TextSize = 16.000\nMouseFrameContextLabel.TextXAlignment = Enum.TextXAlignment.Left\nMouseFrameContextLabel.TextYAlignment = Enum.TextYAlignment.Top\nMouseFrameContextLabel.AutomaticSize = Enum.AutomaticSize.XY\nMouseFrameContextLabel.AutoLocalize = false\nMouseFrameContextLabelUICorner.CornerRadius = UDim.new(0, 4)\nMouseFrameContextLabelUICorner.Parent = MouseFrameContextLabel\n------------------------\n\nGUI.Main.Topbar.DragBox.MouseButton1Down:Connect(LockGuiToMouse)\nMouse.Button1Up:Connect(UnlockGuiToMouse)\nGUI.Main.Topbar.DragBox.MouseButton1Up:Connect(UnlockGuiToMouse)\n\nGUI.Main.Topbar.Buttons.Scale.MouseButton1Click:Connect(function()\n\tif not SizeCooldown then\n\t\tspawn(function()\n\t\t\tSizeCooldown = true\n\t\t\twait(0.2)\n\t\t\tSizeCooldown = false\n\t\tend)\n\t\tif not FullScale and not Minimized then\n\t\t\tLastScale = GUI.Main.Size\n\t\t\tLastPosition = GUI.Main.Position\n\t\t\tTweenService:Create(GUI.Main,TweenInfo.new(0.2,Enum.EasingStyle.Circular),{Size=UDim2.new(1,0,1,0),Position = UDim2.new(0.5,0,0.5,0)}):Play()\n\t\t\tTweenService:Create(GUI.Main.Content,TweenInfo.new(0.2,Enum.EasingStyle.Circular),{Size = UDim2.new(1,0,1,-24),Position = UDim2.new(0,0,0,24)}