ue = Object:FindFirstChild("Context")\n\t\tif ContextValue then\n\t\t\tif ContextValue:IsA("StringValue") then\n\t\t\t\tObject.MouseEnter:Connect(function()\n\t\t\t\t\tMouseFrame.ContextLabel.Text = ContextValue.Value\n\t\t\t\t\tButtonsFocused = ButtonsFocused +1\n\t\t\t\tend)\n\t\t\t\tObject.MouseLeave:Connect(function()\n\t\t\t\t\tButtonsFocused = ButtonsFocused -1\n\t\t\t\tend)\n\t\t\tend\n\t\tend\n\tend\nend\n\nfor _,Object in pairs(script.Parent:GetDescendants()) do\n\tRegisterButton(Object)\nend\nscript.Parent.DescendantAdded:Connect(RegisterButton)\n\nRunService.RenderStepped:Connect(function()\n\tif DragMainEnabled then\n\t\tlocal Difference = Vector2.new(Mouse.X-InitialMousePosition.X,Mouse.Y-InitialMousePosition.Y)\n\t\tGUI.Main.Position = UDim2.new(0.5,InitialFramePosition.X.Offset+Difference.X,0.5,InitialFramePosition.Y.Offset+Difference.Y)\n\tend\n\tMouseFrame.Position = UDim2.new(0,Mouse.X+16,0,Mouse.Y+16)\n\tif ButtonsFocused >= 1 then\n\t\tMouseFrame.ContextLabel.Visible = true\n\telseif ButtonsFocused == 0 then\n\t\tMouseFrame.ContextLabel.Visible = false\n\tend\nend)\n\nlocal Remote = script:WaitForChild("Remote")\n\nRemote.OnClientInvoke = function(Request,Arguments)\n\tlocal ReturnArguments = {}\n\tif Request and Arguments then\n\t\tif Request == "PlayClose" then\n\t\t\tGUI.Main.Content.Visible = false\n\t\t\tGUI.Main.ClipsDescendants = true\n\t\t\tfor _,A in pairs(GUI:GetDescendants()) do\n\t\t\t\tif  A:IsA("Frame") then\t\t\n\t\t\t\t\tTweenService:Create(A,TweenInfo.new(0.25,Enum.EasingStyle.Circular,Enum.EasingDirection.In),{BackgroundTransparency=1}):Play()\n\t\t\t\telseif A:IsA("TextButton") or A:IsA("TextBox") then\n\t\t\t\t\tTweenService:Create(A,TweenInfo.new(0.25,Enum.EasingStyle.Circular,Enum.EasingDirection.In),{BackgroundTransparency=1,TextTransparency=1}):Play()\n\t\t\t\telseif A:IsA("ImageLabel") or A:IsA("ImageButton") then\n\t\t\t\t\tTweenService:Create(A,TweenInfo.new(0.25,Enum.EasingStyle.Circular,Enum.EasingDirection.In),{BackgroundTransparency=1,ImageTransparency=1}):Play()\n\t\t\t\tend\n\t\t\tend\n\t\t\tTweenService:Create(GUI.Main,TweenInfo.new(0.25,Enum.EasingStyle.Circular,Enum.EasingDirection.In),{Size=UDim2.new(0,10,0,0)}):Play()\n\t\t\twait(0.3)\n\t\tend\n\tend\n\treturn ReturnArguments\nend\n\n--Scaling folder creation--\nlocal ScaleFolder = Instance.new("Folder")\nlocal TopScaleButton = Instance.new("TextButton")\nlocal BottomScaleButton = Instance.new("TextButton")\nlocal LeftScaleButton = Instance.new("TextButton")\nlocal RightScaleButton = Instance.new("TextButton")\nlocal TopLeftScaleButton = Instance.new("TextButton")\nlocal BottomLeftScaleButton = Instance.new("TextButton")\nlocal BottomRightScaleButton = Instance.new("TextButton")\nlocal TopRightScaleButton = Instance.new("TextButton")\nTopScaleButton.AutoLocalize = false\nBottomScaleButton.AutoLocalize = false\nLeftScaleButton.AutoLocalize = false\nRightScaleButton.AutoLocalize = false\nTopLeftScaleButton.AutoLocalize = false\nBottomLeftScaleButton.AutoLocalize = false\nBottomRightScaleButton.AutoLocalize = false\nTopRightScaleButton.AutoLocalize = false\nScaleFolder.Name = "ScalingPoints"\nScaleFolder.Parent = GUI.Main\nTopScaleButton.Name = "Top"\nTopScaleButton.Parent = ScaleFolder\nTopScaleButton.BackgroundColor3 = Color3.fromRGB(0, 170, 255)\nTopScaleButton.BackgroundTransparency = 1.000\nTopScaleButton.BorderColor3 = Color3.fromRGB(0, 0, 0)\nTopScaleButton.BorderSizePixel = 0\nTopScaleButton.Position = UDim2.new(0, 0, 0, -8)\nTopScaleButton.Size = UDim2.new(1, 0, 0, 8)\nTopScaleButton.Font = Enum.Font.SourceSans\nTopScaleButton.Text = ""\nTopScaleButton.TextColor3 = Color3.fromRGB(0, 0, 0)\nTopScaleButton.TextSize = 14.000\nTopScaleButton.AutoButtonColor = false\nBottomScaleButton.Name = "Bottom"\nBottomScaleButton.Parent = ScaleFolder\nBottomScaleButton.BackgroundColor3 = Color3.fromRGB(0, 170, 255)\nBottomScaleButton.BackgroundTransparency = 1.000\nBottomScaleButton.BorderColor3 = Color3.fromRGB(0, 0, 0)\nBottomS