                                                    Value = [[\n---------------------------------------------------------------------------------------------------\n--SUPERNOVA | TASKBAR CLIENT | BY @THEWETER | CREATED: 4/6/2024 | MODIFIED: 7/13/2025\n---------------------------------------------------------------------------------------------------\n\nlocal PlayerService = game:GetService("Players")\nlocal Player = PlayerService.LocalPlayer\nlocal PlayerGui = Player.PlayerGui\nlocal Main = script.Parent.Main\nlocal _DateAndTime = Main.DateandTime\nlocal _Date = _DateAndTime.Date\nlocal _Time = _DateAndTime.Time\nlocal WindowBar = Main.Windows\nlocal MenuButton = Main.MenuButton\nlocal ReplicatedStorage = game:GetService("ReplicatedStorage")\nlocal ReplicatedFolder = ReplicatedStorage:WaitForChild("SupernovaAdmin")\nlocal Bridge = ReplicatedFolder:WaitForChild("Bridge")\nlocal CommunicationEvent = ReplicatedFolder:WaitForChild("CommunicationEvent")\nlocal ContentProvider = game:GetService("ContentProvider")\nlocal Mouse = Player:GetMouse()\nlocal Busy = 0\n\nlocal function FindProcessImageFromWindow(Window)\n\tlocal ImageID = "http://www.roblox.com/asset/?id=17047593162"\n\tif Window then\n\t\tif Window.ClassName == "ScreenGui" then\n\t\t\tlocal ProcessInformationValue = Window:FindFirstChild("ProcessInformation")\n\t\t\tif ProcessInformationValue then\n\t\t\t\tif ProcessInformationValue.ClassName == "StringValue" then\n\t\t\t\t\tif ProcessInformationValue.Value == "Supernova" then\n\t\t\t\t\t\tlocal ProgramIcon = ProcessInformationValue:FindFirstChild("ProgramIcon")\n\t\t\t\t\t\tif ProgramIcon then\n\t\t\t\t\t\t\tif ProgramIcon.ClassName == "StringValue" then\n\t\t\t\t\t\t\t\tImageID = ProgramIcon.Value\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\tend\n\treturn ImageID\t\nend\n\nlocal function FindTopbarImageFromWindow(Window)\n\tlocal ImageID = "http://www.roblox.com/asset/?id=17047593162"\n\tif Window then\n\t\tif Window.ClassName == "ScreenGui" then\n\t\t\tlocal ProcessInformationValue = Window:FindFirstChild("ProcessInformation")\n\t\t\tfor _,Object in pairs(Window:GetDescendants()) do\n\t\t\t\tif Object.ClassName == "StringValue" then\n\t\t\t\t\tif Object.Name == "Identifier" then\n\t\t\t\t\t\tif Object.Value == "Supernova_ProgramImage" then\n\t\t\t\t\t\t\tlocal ImageObject = Object.Parent\n\t\t\t\t\t\t\tif ImageObject.ClassName == "ImageLabel" then\n\t\t\t\t\t\t\t\tImageID = ImageObject.Image\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\tend\n\treturn ImageID\t\nend\n\nlocal function FindTitleFromWindow(Window)\n\tlocal Title = "Application"\n\tif Window then\n\t\tif Window.ClassName == "ScreenGui" then\n\t\t\tlocal ProcessInformationValue = Window:FindFirstChild("ProcessInformation")\n\t\t\tfor _,Object in pairs(Window:GetDescendants()) do\n\t\t\t\tif Object.ClassName == "StringValue" then\n\t\t\t\t\tif Object.Name == "Identifier" then\n\t\t\t\t\t\tif Object.Value == "Supernova_ProgramTitle" then\n\t\t\t\t\t\t\tlocal TextObject = Object.Parent\n\t\t\t\t\t\t\tif TextObject.ClassName == "TextLabel" then\n\t\t\t\t\t\t\t\tTitle = TextObject.Text\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\tend\n\treturn Title\t\nend\n\nlocal function FindWindowsWithProcessID(ProcessID)\n\tlocal Windows = {}\n\tfor _,Window in pairs(PlayerGui:GetChildren()) do\n\t\tif Window.ClassName == "ScreenGui" then\n\t\t\tlocal ProcessInformationValue = Window:FindFirstChild("ProcessInformation")\n\t\t\tif ProcessInformationValue then\n\t\t\t\tif ProcessInformationValue.ClassName == "StringValue" then\n\t\t\t\t\tif ProcessInformationValue.Value == "Supernova" then\n\t\t\t\t\t\tlocal ProgramID = ProcessInformationValue:FindFirstChild("ProgramID")\n\t\t\t\t\t\tif ProgramID then\n\t\t\t\t\t\t\tif ProgramID.ClassName == "StringValue" then\n\t\t\t\t\t\t\t\tif string.lower(tostring(ProgramID.Value)) == string.lower(tostring(ProcessID)) then\n\t\t\t\t\t\t\t\t\ttable.insert(Windows,Window)\n\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\tend\n\treturn Windows\nend\n\nlocal function FindButtonWithProcessID(ProcessID)\n\tlocal ToFind = tostring(ProcessID)\n\tlocal ToReturn = {}\n\tfor _,B in pairs(WindowBar:GetChildren()) do\n\t\tlocal ProcessInformationValue = B:FindFirstChild("ProcessInformation")\n\t\tif ProcessInformationValue then\n\t\t\tif ProcessInformationValue.ClassName == "StringValue" then\n\t\t\t\tif ProcessInformationValue.Value == "Supernova" then\n\t\t\t\t\tlocal ProgramID = ProcessInformationValue:FindFirstChild("ProgramID")\n\t\t\t\t\tif ProgramID then\n\t\t\t\t\t\tif ProgramID.ClassName == "StringValue" then\n\t\t\t\t\t\t\tif string.lower(tostring(ProgramID.Value)) == string.lower(ToFind) then\n\t\t\t\t\t\t\t\ttable.insert(ToReturn,B)\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\tend\n\treturn ToReturn\nend\n\nlocal function PrioritizeWindow(Window)\n\tfor _,_Window in pairs(PlayerGui:GetChildren()) do\n\t\tlocal ProcessInformationValue = _Window:FindFirstChild("ProcessInformation")\n\t\tif ProcessInformationValue then\n\t\t\tif ProcessInformationValue.ClassName == "StringValue" then\n\t\t\t\tif ProcessInformationValue.Value == "Supernova" then\n\t\t\t\t\t_Window.DisplayOrder = 999999999\n\t\t\t\tend\t\n\t\t\tend\t\t\n\t\tend\n\tend\n\tWindow.DisplayOrder = 1000000000\nend\n\nlocal function CheckIfPriority(Window)\n\tlocal IsPriority = false\n\tlocal ProcessInformationValue = Window:FindFirstChild("ProcessInformation")\n\tif ProcessInformationValue then\n\t\tif ProcessInformationValue.ClassName == "StringValue" then\n\t\t\tif ProcessInformationValue.Value == "Supernova" then\n\t\t\t\tif Window.DisplayOrder == 1000000000 then\n\t\t\t\t\tIsPriority = true\n\t\t\t\tend\n\t\t\tend\t\n\t\tend\t\t\n\tend\n\treturn IsPriority\nend\n\nlocal function CreateWindowSelection(ProcessID)\n\tMain.WindowSelector.Visible = false\n\tfor _,V in pairs(Main.WindowSelector.Main.Windows:GetChildren()) do\n\t\tif V:IsA("Frame") then\n\t\t\tV:Destroy()\n\t\tend\n\tend\n\tlocal Windows = FindWindowsWithProcessID(ProcessID)\n\tfor _,Window in pairs(Windows) do\n\t\tlocal Image = FindTopbarImageFromWindow(Window)\n\t\tlocal Title = FindTitleFromWindow(Window)\n\t\tlocal SelectionButton = script.WindowSelection:Clone()\n\t\tSelectionButton.Main.ProgramIcon.Image = Image\n\t\tSelectionButton.Main.ProgramTitle.Text = Title\n\t\tSelectionButton.Parent = Main.WindowSelector.Main.Windows\n\t\tSelectionButton.TextButton.MouseButton1Click:Connect(function()\n\t\t\tMain.WindowSelector.Visible = false \n\t\t\tPrioritizeWindow(Window)\n\t\t\tfor _,V in pairs(Window:GetChildren()) do\n\t\t\t\tfor _,A in pairs(V:GetChildren()) do\n\t\t\t\t\tif A:IsA("BindableFunction") then\n\t\t\t\t\t\tif A.Name == "Function" then\n\t\t\t\t\t\t\tif A.Parent:IsA("LocalScript") then\n\t\t\t\t\t\t\t\tA:Invoke("Maximize",{})\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\tend)\n\tend\n\tMain.WindowSelector.Visible = true\nend\n\nlocal function ButtonLeftClick(ProcessID)\n\tlocal ProgramID = string.lower(tostring(ProcessID))\n\tlocal Windows = FindWindowsWithProcessID(ProgramID)\n\tlocal TotalWindowsWithID = #Windows\n\tif TotalWindowsWithID > 1 then\n\t\tCreateWindowSelection(ProgramID)\n\telseif TotalWindowsWithID == 1 then\n\t\tlocal Window = Windows[1]\n\t\tlocal IsPriority = CheckIfPriority(Window)\n\t\tlocal Minimized = true\n\t\tfor _,V in pairs(Window:GetChildren()) do\n\t\t\tfor _,A in pairs(V:GetChildren()) do\n\t\t\t\tif A:IsA("BindableFunction") then\n\t\t\t\t\tif A.Name == "Function" then\n\t\t\t\t\t\tif A.Parent:IsA("LocalScript") then\n\t\t\t\t\t\t\tMinimized = A:Invoke("CheckToggled",{}).Minimized\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\tend\t\n\t\tif IsPriority then\n\t\t\tfor _,V in pairs(Window:GetChildren()) do\n\t\t\t\tfor _,A in pairs(V:GetChildren()) do\n\t\t\t\t\tif A:IsA("BindableFunction") then\n\t\t\t\t\t\tif A.Name == "Function" then\n\t\t\t\t\t\t\tif A.Parent:IsA("LocalScript") then\n\t\t\t\t\t\t\t\tA:Invoke("Toggle",{})\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\telseif not IsPriority then\n\t\t\tif Minimized then\n\t\t\t\tfor _,V in pairs(Window:GetChildren()) do\n\t\t\t\t\tfor _,A in pairs(V:GetChildren()) do\n\t\t\t\t\t\tif A:IsA("BindableFunction") then\n\t\t\t\t\t\t\tif A.Name == "Function" then\n\t\t\t\t\t\t\t\tif A.Parent:IsA("LocalScript") then\n\t\t\t\t\t\t\t\t\tA:Invoke("Maximize",{})\n\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\t\tPrioritizeWindow(Window)\n\t\t\telseif not Minimized then\n\t\t\t\tPrioritizeWindow(Window)\n\t\t\tend\n\t\tend\n\telseif TotalWindowsWithID == 0 then\n\t\tBridge:InvokeServer("LaunchWithLaunchID",{LaunchID=ProgramID})\n\tend\nend\n\nlocal function ButtonRightClick(ProcessID)\n\tlocal ProgramID = string.lower(tostring(ProcessID))\n\t--print(ProgramID.." Button Right Clicked")\nend\n\nlocal function ButtonHover(ProcessID)\n\nend\n\nlocal function ButtonHovered(ProcessID)\n\nend\n\nlocal function CreateButton(ProcessID)\n\tlocal Button = script.Button:Clone()\n\tButton.Parent = WindowBar\n\tButton.ProcessInformation.ProgramID.Value = string.lower(tostring(ProcessID))\n\tButton.TextButton.MouseButton1Click:Connect(function()\n\t\tButtonLeftClick(ProcessID)\n\tend)\n\tButton.TextButton.MouseButton2Click:Connect(function()\n\t\tButtonRightClick(ProcessID)\n\tend)\n\treturn Button\nend\n\nlocal function RemoveButton(ProcessID)\n\tfor _,Button in pairs(WindowBar:GetChildren()) do\n\t\tif Button:IsA("Frame") then\n\t\t\tif tostring(ProcessID) == Button.ProcessInformation.ProgramID.Value then\n\t\t\t\tif not Button.ProcessInformation.Pinned.Value then\n\t\t\t\t\tButton:Destroy()\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\tend\nend\n\nlocal function FindButton(ProcessID)\n\tlocal Button = FindButtonWithProcessID(ProcessID)\n\tif not Button[1] then\n\t\tButton = CreateButton(ProcessID)\n\tend\n\tlocal Window = FindWindowsWithProcessID(ProcessID)[1]\n\tif Window then\n\t\tif not pcall(function()\n\t\t\t\tlocal ImageID = FindProcessImageFromWindow(Window)\n\t\t\t\tif ImageID then\n\t\t\t\t\tButton.ImageLabel.Image = ImageID\n\t\t\t\tend\n\t\t\t\tButton.BackgroundTransparency = 0.7\n\t\t\t\tButton.UIStroke.Transparency = 0.5\n\t\t\t\tWindow.Changed:Connect(function()\n\t\t\t\t\tif Window.DisplayOrder == 1000000000 then\n\t\t\t\t\t\tButton.BackgroundTransparency = 0.5\n\t\t\t\t\telseif Window.DisplayOrder == 999999999 then\n\t\t\t\t\t\tButton.BackgroundTransparency = 0.7\n\t\t\t\t\tend\n\t\t\t\tend)\n\t\t\tend) then\n\t\t\t--print("Failed to run find function for Process ID: "..ProcessID)\n\t\tend\n\n\tend\n\treturn Button\nend\n\nlocal function Refresh()\n\tfor _,Button in pairs(WindowBar:GetChildren()) do\n\t\tif Button:IsA("Frame") then\n\t\t\tlocal ProcessInformationValue = Button:FindFirstChild("ProcessInformation")\n\t\t\tif ProcessInformationValue then\n\t\t\t\tif ProcessInformationValue.ClassName == "StringValue" then\n\t\t\t\t\tif ProcessInformationValue.Value == "Supernova" then\n\t\t\t\t\t\tlocal ProgramID = ProcessInformationValue:FindFirstChild("ProgramID")\n\t\t\t\t\t\tif ProgramID then\n\t\t\t\t\t\t\tif ProgramID.ClassName == "StringValue" then\n\t\t\t\t\t\t\t\tlocal ProcessID = string.lower(tostring(ProgramID.Value))\n\t\t\t\t\t\t\t\tif FindWindowsWithProcessID(ProcessID)[1] == nil then\n\t\t\t\t\t\t\t\t\tRemoveButton(ProcessID)\n\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\t\t\t\n\t\tend\n\tend\n\tfor _,ScreenGui in pairs(PlayerGui:GetChildren()) do\n\t\tif ScreenGui.ClassName == "ScreenGui" then\n\t\t\tlocal ProcessInformationValue = ScreenGui:FindFirstChild("ProcessInformation")\n\t\t\tif ProcessInformationValue then\n\t\t\t\tif ProcessInformationValue.ClassName == "StringValue" then\n\t\t\t\t\tif ProcessInformationValue.Value == "Supernova" then\n\t\t\t\t\t\tlocal ProgramID = ProcessInformationValue:FindFirstChild("ProgramID")\n\t\t\t\t\t\tif ProgramID then\n\t\t\t\t\t\t\tif ProgramID.ClassName == "StringValue" then\n\t\t\t\t\t\t\t\tlocal TaskbarVisibility = ProcessInformationValue:FindFirstChild("TaskbarVisibility")\n\t\t\t\t\t\t\t\tif TaskbarVisibility then\n\t\t\t\t\t\t\t\t\tif TaskbarVisibility.ClassName == "BoolValue" then\n\t\t\t\t\t\t\t\t\t\tif TaskbarVisibility.Value then\n\t\t\t\t\t\t\t\t\t\t\tFindButton(string.lower(tostring(ProgramID.Value)))\n\n\t\t\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\tend\nend\n\nPlayerGui.ChildAdded:Connect(Refresh)\nPlayerGui.ChildRemoved:Connect(Refresh)\n\nlocal ConnectionIconBox = Main.ToolButtons.Connection\nlocal ConnectionIcon = ConnectionIconBox.Icon.Level\nlocal ConnectionIconBoxes = {\n\tConnectionIcon._1;\n\tConnectionIcon._2;\n\tConnectionIcon._3;\n\tConnectionIcon._4;\n\tConnectionIcon._5;\n}\n\nlocal function SetConnectionIcon(Number)\n\tlocal _Number = tonumber(Number)\n\tif _Number then\n\t\tConnectionIcon.Warn.Visible = false\n\t\tConnectionIcon.Unavailable.Visible = false\n\t\tif _Number == 0 then\n\t\t\tConnectionIcon.Warn.Visible = true\n\t\tend\n\t\tif _Number == -1 then\n\t\t\tConnectionIcon.Unavailable.Visible = true\n\t\tend\n\t\tfor _,V in pairs(ConnectionIconBoxes) do\n\t\t\tV.Transparency = 1\n\t\tend\n\t\tif _Number > 0 then\n\t\t\tfor i=1,_Number do\n\t\t\t\tif ConnectionIconBoxes[i] then\n\t\t\t\t\tConnectionIconBoxes[i].Transparency = 0\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\tend\nend\n\nspawn(function()\n\twhile true do\n\t\twait(1)\n\t\t_Time.Text = DateTime.now():FormatLocalTime("LT", "en-us")\n\t\t_Date.Text = DateTime.now():FormatLocalTime("L", "en-us")\n\t\tlocal Status = 5\n\t\tlocal Success,Results = pcall(function()\n\t\t\tlocal BeforeTime = os.clock()\n\t\t\tBridge:InvokeServer("Ping",{})\n\t\t\tlocal AfterTime = os.clock()\n\t\t\tlocal TotalTime = math.round((AfterTime-BeforeTime)*1000)\n\t\t\tif TotalTime > 60 then\n\t\t\t\tStatus = 5\n\t\t\tend\n\t\t\tif TotalTime > 100 then\n\t\t\t\tStatus = 4\n\t\t\tend\n\t\t\tif TotalTime > 160 then\n\t\t\t\tStatus = 3\n\t\t\tend\n\t\t\tif TotalTime > 320 then\n\t\t\t\tStatus = 2\n\t\t\tend\n\t\t\tif TotalTime > 600 then\n\t\t\t\tStatus = 1\n\t\t\tend\n\t\tend)\n\t\tif not Success then\n\t\t\tStatus = 0\n\t\tend\n\t\tSetConnectionIcon(Status)\n\tend\nend)\n\nlocal TweenService = game:GetService("TweenService")\n\nlocal ViewCooldown = false\n\nlocal TriggerButton = Main.ViewTrigger\n\nlocal function TriggerView()\n\tif not ViewCooldown then\n\t\tViewCooldown = true\n\t\tTweenService:Create(TriggerButton,TweenInfo.new(0.5),{ImageTransparency=1}):Play()\n\t\tTweenService:Create(Main,TweenInfo.new(0.5),{Position=UDim2.new(0,0,1,-38)}):Play()\n\t\twait(0.5)\n\t\tlocal WaitingFunctions = {}\n\t\tfunction WaitingFunctions:WaitForUserToFinish()\n\t\t\trepeat wait() until Main.Start.Visible == false and Main.ToolButtons.Connection.Menu.Visible == false and Main.ToolButtons.Sound.Adjust.Visible == false\n\t\t\twait(6)\n\t\t\tWaitingFunctions:CheckIfReady()\n\t\tend\n\t\tfunction WaitingFunctions:CheckIfReady()\n\t\t\tif Main.Start.Visible == false and Main.ToolButtons.Connection.Menu.Visible == false and Main.ToolButtons.Sound.Adjust.Visible == false then\n\t\t\telse\n\t\t\t\tWaitingFunctions:WaitForUserToFinish()\n\t\t\tend\n\t\tend\n\t\tWaitingFunctions:WaitForUserToFinish()\n\t\tTweenService:Create(Main,TweenInfo.new(1),{Position=UDim2.new(0,0,1,0)}):Play()\n\t\tTweenService:Create(TriggerButton,TweenInfo.new(0.5),{ImageTransparency=0.5}):Play()\n\t\twait(1)\n\t\tViewCooldown = false\n\tend\nend\n\nMouse.KeyDown:Connect(function(key)\n\tif key:byte() == 61 then\n\t\tTriggerView()\n\tend\nend)\n\n\nTriggerButton.MouseButton1Click:Connect(TriggerView)\n\nMouse.Button1Down:Connect(function()\n\tlo