                Source = {
                    Name = [[Source]],
                    Value = [[local LocaleHandler = require(script.Parent.LocaleHandler)\nreturn function(Bridge,System,Settings,PlayerCommunications,Commands,Plugins,UILibraryModule,StartTime,NavigationModule)\n\tBridge.OnServerInvoke = function(Player,Request,Arguments)\n\t\tlocal CurrentPlayerLanguage = System:GetCurrentLanguage(Player)\n\t\tlocal ReturnArguments = {}\n\t\tif Arguments and Request then\n\t\t\tlocal FormattedRequest = string.lower(tostring(Request))\n\t\t\tif FormattedRequest == "runcommand" then\n\t\t\t\tlocal Command = tostring(Arguments.Command)\n\t\t\t\tif Command then\n\t\t\t\t\tif Command ~= "" then\n\t\t\t\t\t\tlocal CommandToRun = Command\n\t\t\t\t\t\tif string.sub(Command,1,string.len(Settings.Interface.Call)) ~= Settings.Interface.Call then\n\t\t\t\t\t\t\tCommandToRun = Settings.Interface.Call..Command\n\t\t\t\t\t\telseif string.sub(Command,1,string.len(Settings.Interface.Call)) == Settings.Interface.Call then\n\t\t\t\t\t\t\tCommandToRun = Command\n\t\t\t\t\t\tend\n\t\t\t\t\t\tSystem:RunCommand(Player,CommandToRun)\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\telseif FormattedRequest == "getcommandsyntax" then\n\t\t\t\tReturnArguments.Call = Settings.Interface.Call\n\t\t\telseif FormattedRequest == "getthemesounds" then\n\t\t\t\t--[[if CurrentPlayerLanguage == "English" then\n\t\t\t\t\tPlayerCommunications.Notify(Player, "Unavailable", "Theme sounds have been depreciated.", UILibraryModule.NotificationImages.Error, 7, "Error")\n\t\t\t\telseif CurrentPlayerLanguage == "Français" then\n\t\t\t\t\tPlayerCommunications.Notify(Player, "Non disponible", "Les sons thématiques ont été dépréciés.", UILibraryModule.NotificationImages.Error, 7, "Error")\n\t\t\t\tend]]--\n\t\t\t\treturn nil\n\t\t\telseif FormattedRequest == "ping" then\n\t\t\t\ttable.insert(ReturnArguments,true)\n\t\t\telseif FormattedRequest == "launchwithlaunchid" then\n\t\t\t\tfor _,CommandCheck in pairs(Commands) do\n\t\t\t\t\tif CommandCheck.LaunchID ~= nil then\n\t\t\t\t\t\tif Arguments.LaunchID == CommandCheck.LaunchID then\n\t\t\t\t\t\t\tSystem:RunCommand(Player,Settings.Interface.Call..CommandCheck.Details[CurrentPlayerLanguage].Name[1])\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\telseif FormattedRequest == "getlaunchidlist" then\n\t\t\t\tfor _,CommandCheck in pairs(Commands) do\n\t\t\t\t\tif CommandCheck.LaunchID ~= nil then\n\t\t\t\t\t\tlocal NewTable = {\n\t\t\t\t\t\t\tLaunchId = CommandCheck.LaunchID;\n\t\t\t\t\t\t\tTitle = CommandCheck.Details[CurrentPlayerLanguage].Name[1];\n\t\t\t\t\t\t\tDescription = CommandCheck.Details[CurrentPlayerLanguage].Description;\n\t\t\t\t\t\t\tIcon = CommandCheck.Icon or "rbxassetid://17047593162";\n\t\t\t\t\t\t\tSmallIcon = CommandCheck.SmallIcon or CommandCheck.Icon or "rbxassetid://17047593162";\n\t\t\t\t\t\t\tVisible = CommandCheck.Visible;\n\t\t\t\t\t\t}\n\t\t\t\t\t\ttable.insert(ReturnArguments,NewTable)\n\t\t\t\t\tend\n\t\t\t\tend\n\n\t\t\telseif FormattedRequest == "checkifutilitybarenabled" then\n\t\t\t\tReturnArguments.Enabled = false\n\t\t\t\tif string.lower(Settings.Interface.MenuButtonType) == "utilitybar" then\n\t\t\t\t\tReturnArguments.Enabled = true\n\t\t\t\telseif string.lower(Settings.Interface.MenuButtonType) == "legacyutilitybar" then\n\t\t\t\t\tReturnArguments.Enabled = true\n\t\t\t\tend\n\t\t\telseif FormattedRequest == "getpossiblecommands" then\n\t\t\t\tlocal CommandString = tostring(Arguments.Command)\n\t\t\t\tlocal CommandToRun = CommandString\n\t\t\t\tif string.sub(CommandString,1,string.len(Settings.Interface.Call)) ~= Settings.Interface.Call then\n\t\t\t\t\tCommandToRun = Settings.Interface.Call..CommandString\n\t\t\t\telseif string.sub(CommandString,1,string.len(Settings.Interface.Call)) == Settings.Interface.Call then\n\t\t\t\t\tCommandToRun = CommandString\n\t\t\t\tend\n\t\t\t\t---------------------------------------------------\n\t\t\t\tlocal Arguments = string.split(CommandToRun," ")\n\t\t\t\tlocal SearchingFor = string.lower(LocaleHandler.Accents.Remove(Arguments[1]),CurrentPlayerLanguage)\n\t\t\t\t---------------------------------------------------\n\t\t\t\tpcall(function()\n\t\t\t\t\tfor _,Command in pairs(Commands) do\n\t\t\t\t\t\tfor _,N in pairs(Command.Details[CurrentPlayerLanguage].Name) do\n\t\t\t\t\t\t\tlocal ComparingAgainst = string.lower(LocaleHandler.Accents.Remove(Settings.Interface.Call..N),CurrentPlayerLanguage)\n\t\t\t\t\t\t\tif string.find(ComparingAgainst,SearchingFor) then\n\t\t\t\t\t\t\t\tif Command.Enabled and Command.Visible then\n\t\t\t\t\t\t\t\t\ttable.insert(ReturnArguments,{N,Command.Details[CurrentPlayerLanguage].SyntaxDescription})\n\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend\n\t\t\t\t\tlocal PluginSuccess,PluginResults = pcall(function()\n\t\t\t\t\t\tfor _,LoadedPlugin in pairs(Plugins) do\n\t\t\t\t\t\t\tif LoadedPlugin.VERSION >= 5 then\n\t\t\t\t\t\t\t\tfor _,Command in pairs(LoadedPlugin.Commands) do\n\t\t\t\t\t\t\t\t\tif Command.Details[CurrentPlayerLanguage] then\n\t\t\t\t\t\t\t\t\t\tfor _,N in pairs(Command.Details[CurrentPlayerLanguage].Name) do\n\t\t\t\t\t\t\t\t\t\t\tlocal ComparingAgainst = string.lower(LocaleHandler.Accents.Remove(Settings.Interface.Call..N),CurrentPlayerLanguage)\n\t\t\t\t\t\t\t\t\t\t\tif string.find(ComparingAgainst,SearchingFor) then\n\t\t\t\t\t\t\t\t\t\t\t\tif Command.Enabled and Command.Visible then\n\t\t\t\t\t\t\t\t\t\t\t\t\ttable.insert(ReturnArguments,{N,Command.Details[CurrentPlayerLanguage].SyntaxDescription})\n\t\t\t\t\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\t\tend\n\t\t\t\t\t\t\tend\n\t\t\t\t\t\tend\n\t\t\t\t\tend)\n\t\t\t\tend)\n\t\t\t\t----------------------------------------------------------------\n\t\t\telseif FormattedRequest == "getstarttime" then\n\t\t\t\treturn StartTime\n\t\t\telseif FormattedRequest == "getruntime" then\n\t\t\t\treturn os.time() - StartTime\n\t\t\telseif FormattedRequest == "getnavurl" then\n\t\t\t\tlocal LoadedPage = NavigationModule(Player,"geturl",Arguments,System,Bridge)\n\t\t\t\tif string.match(LoadedPage.Name,"(404)") then\n\t\t\t\t\tSystem:PromptUser(Player,"Navigator",LocaleHandler.PhraseFromId(CurrentPlayerLanguage,"scnf",{Arguments[1]}),UILibraryModule.PromptImages.Error,{{Id="OK",Text="OK"}},"Error")\n\t\t\t\tend\n\t\t\t\treturn LoadedPage\n\t\t\telseif FormattedRequest == "getlocale" then\n\t\t\t\tlocal Searching = Arguments[1]\n\t\t\t\tlocal locale = LocaleHandler.PhraseFromId(CurrentPlayerLanguage,Searching)\n\t\t\t\treturn locale\n\t\t\tend\n\t\tend\n\t\treturn ReturnArguments\n\tend\nend]]
