                            Properties = {
                                Source = {
                                    Name = [[Source]],
                                    Value = [[local function CreateUniqueId()\n\tlocal UniqueId = Instance.new("StringValue")\n\tUniqueId.Name = "SupernovaUniqueId"\n\tUniqueId.Value = "SUID:"..string.split(tostring(math.random()),".")[2]\nend\n\nlocal UniqueIdFunction = {\n\tGet = function(Object)\n\t\tlocal UniqueId = Object:FindFirstChild("SupernovaUniqueId")\n\t\tlocal SUID\n\t\tif UniqueId then\n\t\t\t--print(UniqueId.Value)\n\t\t\tSUID = string.split(UniqueId.Value,":")[2]\n\t\telseif not UniqueId then\n\t\t\tUniqueId = Instance.new("StringValue")\n\t\t\tUniqueId.Name = "SupernovaUniqueId"\n\t\t\tSUID = string.split(tostring(math.random()),".")[2]\n\t\t\tUniqueId.Value = "SUID:"..SUID\n\t\t\tUniqueId.Parent = Object\n\t\t\t--print(UniqueId.Value)\n\t\tend\n\t\treturn UniqueId,SUID\n\tend,\n}\n\nreturn {\n\tLoad = function(Player,Arguments,TableInstance,System,Bridge)\n\t\tlocal NewFrame = script.Explore:Clone()\n\t\tlocal Location = game\n\t\tlocal SearchFor = ""\n\t\tlocal LocationArgument = ""\n\t\tlocal OpenDescendants = ""\n\t\tfor _,Argument in pairs(Arguments) do\n\t\t\tlocal Parts = string.split(Argument,"=")\n\t\t\tif string.lower(Parts[1]) == "location" then\n\t\t\t\tSearchFor = Parts[2]\n\t\t\t\tLocationArgument = Argument\n\t\t\tend\n\t\t\tif string.lower(Parts[1]) == "opendescendants" then\n\t\t\t\tOpenDescendants = Parts[2]\n\t\t\tend\n\t\tend\n\t\tlocal SearchingForWithoutGame = string.split(SearchFor,"game.")[2]\n\t\tif not SearchingForWithoutGame then\n\t\t\tSearchingForWithoutGame = ""\n\t\tend\n\t\tlocal SearchForSplit = string.split(SearchingForWithoutGame,".")\n\t\tlocal Valid = true\n\t\t--print(#SearchForSplit)\n\t\tif #SearchForSplit > 0 and SearchingForWithoutGame ~= "" then\n\t\t\tfor _,Direction in pairs(SearchForSplit) do\n\t\t\t\tlocal FoundIs\n\t\t\t\tfor _,Child in pairs(Location:GetChildren()) do\n\t\t\t\t\tlocal _,UChildId = UniqueIdFunction.Get(Child)\n\t\t\t\t\tif UChildId == Direction then\n\t\t\t\t\t\tLocation = Child\n\t\t\t\t\t\tFoundIs = true\n\t\t\t\t\t\tprint("redirecting")\n\t\t\t\t\tend\n\t\t\t\tend\n\t\t\t\tif not FoundIs then\n\t\t\t\t\tValid = false\n\t\t\t\t\tbreak\n\t\t\t\telse\n\t\t\t\t\tValid = true\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\t\tif Valid then\n\t\t\tlocal InitialOrder = 0\n\t\t\tfor _,Child in pairs(Location:GetChildren()) do\n\t\t\t\tlocal InstanceIcon = TableInstance.InstanceImages:Find(Child.ClassName)\n\t\t\t\tif InstanceIcon ~= "rbxassetid://115816390885004" then\n\t\t\t\t\tlocal ChildIdTag,SUID = UniqueIdFunction.Get(Child)\n\t\t\t\t\tlocal InstanceButton = script.InstanceButton:Clone()\n\t\t\t\t\tInstanceButton.Name = "_"..math.random()\n\t\t\t\t\tInstanceButton.NavigatorValue.Value = "redirect@explorer:explore?location="..SearchFor.."."..SUID\n\t\t\t\t\tInstanceButton.InstanceName.Text = Child.Name\n\t\t\t\t\tInstanceButton.InstanceIcon.Image = InstanceIcon\n\t\t\t\t\tInstanceButton.Parent = NewFrame.ExplorerScroll\n\t\t\t\t\tInstanceButton.LayoutOrder = InitialOrder\n\t\t\t\tend\n\t\t\t\tInitialOrder = InitialOrder+1\n\t\t\tend\n\t\t\tlocal SplitSearchFor = string.split(SearchFor,".")\n\t\t\tlocal Parent = string.split(SearchFor,"."..SplitSearchFor[#SplitSearchFor])[1]\n\t\t\tNewFrame.ParentButton.NavigatorValue.Value = "redirect@explorer:explore?location="..Parent\n\t\telseif not Valid then\n\t\t\tNewFrame = script.Parent.Error404\n\t\tend\n\t\t--print("encoding with tableinstance")\n\t\tlocal EncodedFrame = TableInstance:Encode(NewFrame);\n\t\t--print("done")\n\t\treturn {\n\t\t\tFrame=EncodedFrame;\n\t\t\tName="explore?"..LocationArgument\n\t\t}\n\tend,\n}]]
