                    Properties = {
                        Source = {
                            Name = [[Source]],
                            Value = [[local ReplicatedStorage = game:GetService("ReplicatedStorage")\nlocal TableInstance = require(script.Parent.Parent.TableInstance)\nlocal PlayerService = game:GetService("Players")\n\n-------------------------------------------------------------------------------------------------------\n--Beginning of pages\n-------------------------------------------------------------------------------------------------------\n\nlocal ExploreModule = require(script.ExploreModule)\nlocal PreloadingModule = require(script.PreloadingModule)\n\nlocal NavigatorPages = {\n\tChildren={\n\t\t["404"] = {\n\t\t\tPage = {\n\t\t\t\tName = "File not found (404)";\n\t\t\t\tFrame = TableInstance:Encode(script.Error404);\n\t\t\t};\n\t\t\tRun = function()end;\n\t\t\tChildren = {};\n\t\t};\n\t\t["home"] = {\n\t\t\tPage = {\n\t\t\t\tName = "Explorer - Home";\n\t\t\t\tFrame = TableInstance:Encode(script.Homepage);\n\t\t\t};\n\t\t\tRun = function()end;\n\t\t\tChildren = {};\n\t\t};\n\t\t["start"] = {\n\t\t\tPage = {\n\t\t\t\tName = "Explorer - Preloading assets...";\n\t\t\t\tFrame = TableInstance:Encode(script.Preload1);\n\t\t\t};\n\t\t\tRun = function()end;\n\t\t\tChildren = {};\n\t\t};\n\t\t["preload"] = {\n\t\t\tPage = PreloadingModule.Load;\n\t\t\tChildren = {};\n\t\t};\n\t\t["explore"] = {\n\t\t\tPage = ExploreModule.Load;\n\t\t\tChildren = {};\n\t\t};\n\t};\n}\n\n-------------------------------------------------------------------------------------------------------\n--End of pages\n-------------------------------------------------------------------------------------------------------\n\nlocal Current\n\nreturn function (URL,Player,System,Bridge)--Get page\n\tlocal formattedURL = tostring(URL)\n\tlocal ArgumentsDivision = string.split(formattedURL,"?")\n\tlocal Arguments = {}\n\tif ArgumentsDivision[2] then\n\t\tArguments = string.split(ArgumentsDivision[2],"&")\n\t\t--print("beep boop: "..Arguments[1])\n\tend\n\tlocal segmentedURL = string.split(string.lower(ArgumentsDivision[1]),"/")\n\tlocal Current = NavigatorPages\n\tlocal aller404 = false\n\tfor _,direction in pairs(segmentedURL) do\t\n\t\tlocal Next = Current.Children[string.lower(direction)]\n\t\t--print("searching for: "..direction)\n\t\tif Next then\n\t\t\tCurrent = Next\n\t\t\t--print("found")\n\t\telse\n\t\t\taller404 = true\n\t\t\t--print("not found")\n\t\tend\n\tend\n\tif aller404 then\n\t\tCurrent = NavigatorPages.Children["404"]\n\tend\n\tif type(Current.Page) == "table" then\n\t\tlocal Success,Results = pcall(function()\n\t\t\tCurrent.Run(Player,Arguments,Current.Page.Frame)\n\t\tend)\n\t\tif not Success then\n\t\t\twarn(Results)\n\t\tend\n\t\treturn Current.Page\n\telseif type(Current.Page) == "function" then\n\t\treturn Current.Page(Player,Arguments,TableInstance,System,Bridge)\n\tend\nend\n\n--Created on 2025-06-19 by @MistedWafflez]]
